import React from "react";

const Gallery = (props) => {
  return (
    <div id="portfolio" className="text-center">
      <div className="container">
        <div className="section-title">
          <h2>Gallery</h2>
          <p>
            Explore our stunning makeup transformations, from bridal elegance to
            party glam.
          </p>
        </div>

        <div
          style={{
            display: "grid",
            gap: "16px",
          }}
          className="portfolio-items"
        >
          {props?.data?.length ? (
            props.data.map((item, index) => (
              <div
                key={index}
                style={{
                  width: "100%",
                  height: "500px",
                }}
              >
                <img
                  src={item.smallImage}
                  alt={item.title}
                  style={{
                    width: "100%",
                    height: "100%",
                    objectFit: "cover",
                    borderRadius: "8px",
                  }}
                />
              </div>
            ))
          ) : (
            <p>No gallery data available</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default Gallery;
